import './Navigator.css';
import { NavigatingContext } from './App';
import { useContext } from 'react';

function Navigator() {
    const [navigating, setNavigating] = useContext(NavigatingContext);

    function hideSidebar(e) {
      e.preventDefault();
      setNavigating("notNavigating");
    }

    return (
        <>
        <div className={"NavigatorBackground " + navigating}></div>
        <div className={"Navigator " + navigating}>
            <button className="CloseButton" onClick={hideSidebar}><i className={"fa-solid fa-xmark"}></i></button>
            <button className="NavigationButton">Home&nbsp;<i className={"fa-solid fa-house"}></i></button>
            <button className="NavigationButton">Projects&nbsp;<i className={"fa-solid fa-wrench"}></i></button>
            <button className="NavigationButton">About Me&nbsp;<i className={"fa-solid fa-user"}></i></button>
            <button className="NavigationButton">Contact Me&nbsp;<i className={"fa-solid fa-phone"}></i></button>
        </div>
        </>

    );
  }

  export default Navigator;
